$(function(){
    // clear event on anchor links
    $(document).delegate("a", "click", function(e){
        var href = $(this).attr("href"),
            rexp = new RegExp("^\#([A-z0-9]+)?");
        if (href.match(rexp)!==null) {
            e.preventDefault();
            if (href.length > 1) {
                var anchor = href.substring(1),
                    target = document.getElementById(anchor);
                if ($(target).length) {
                    var offset = $(target).offset();
                    $("html, body").animate({
                        scrollTop: Math.floor(offset.top - 100)
                    }, 400);
                }
            }
        }
    });
    // Init modal
    Modal.construct();
    // Init mobile menu
    MobileMenu.initialize();
    // Init basket
    Basket.construct();
    // Close popups
    $(".body-overlay").on("click", function(){
        Basket.close();
        MobileMenu.close("mobile-menu");
    });
    // Scroll-top button
    $(window).on("scroll", function() {
        var a = $(".scroll-top"),
            sh = window.pageYOffset || document.documentElement.scrollTop,
            dh = Math.max(
                document.body.scrollHeight, document.documentElement.scrollHeight,
                document.body.offsetHeight, document.documentElement.offsetHeight,
                document.body.clientHeight, document.documentElement.clientHeight
            );
        if (sh >= Math.floor(dh/3)) a.addClass("scroll-on");
        else a.removeClass("scroll-on");
    });
    $(".scroll-top").on("click", function(){
        $("html, body").animate({
            scrollTop: 0
        }, 400);
    });
    // Change options
    $(document).on("change", ".product-flypage .options input", function(){
        var label = $(this).closest(".options").find(".option-label"),
            text  = $(this).data("label"),
            checked = $(this).is(":checked");
        if (checked) label.text(text);
    });
    // Selections
    var selections = $(".selections");
    if (selections.length) {
        $.map(selections, function(selection){
            var $slick = $(selection).find(".slick-ready");
            $slick.slick({
                infinite: false,
                prevArrow: "<button type=\"button\" class=\"slick-prev slick-arrow slick-disabled\" role=\"button\"></button>",
                nextArrow: "<button type=\"button\" class=\"slick-next slick-arrow slick-disabled\" role=\"button\"></button>",
                slidesPerRow: 6,
                slidesToShow: 6,
                slidesToScroll: 6,
                responsive: [
                    {
                        breakpoint: 1340,
                        settings: {
                            slidesPerRow: 4,
                            slidesToShow: 4,
                            slidesToScroll: 4
                        }
                    },
                    {
                        breakpoint: 990,
                        settings: {
                            slidesPerRow: 3,
                            slidesToShow: 3,
                            slidesToScroll: 3
                        }
                    },
                    {
                        breakpoint: 640,
                        settings: {
                            slidesPerRow: 2,
                            slidesToShow: 2,
                            slidesToScroll: 2
                        }
                    }
                ]
            });
        });
    }
    // Live search autocomplete
    $(".header-container").on("click", ".search-toggle", function(){
        $(this).toggleClass("toggle-on");
    });
    $(".header-container").on("mouseenter", ".searchbar", function(){
        $(this).addClass("over");
    }).on("mouseleave", ".searchbar", function(){
        $(this).removeClass("over");
    });
    $("body").on("click", ".searchbar", function(e){
        e.stopPropagation();
    }).on("click", function(){
        var sb = $(".searchbar"),
            ls = $(".live-search"),
            st = $(".search-toggle");
        if (ls.length && !sb.hasClass("over")) {
            ls.remove();
        }
    });
    $('#qSearchText').autocomplete({
        source: function(request, response) {
            $.ajax({
                url: $('#searchForm').attr("action"),
                type: 'GET',
                dataType: 'json',
                data: {
                    q: request.term
                }, 
                success: function(json) {
                    $(".live-search").remove();
                    $("#searchForm").removeClass("loading");
                    if (json.output) $('#searchForm').closest(".searchbar").append(json.output);
                },
                beforeSend: function(){
                    $('#searchForm').addClass("loading");
                }
            });
        },
        minLength: 3
    });
});

function MegaMenu(){
    var MobileMenu = {
        opened: false,
        body: null,
        container: null,
        catalog: null,
        slidebar: null,
        controller: null,
        construct: function(){
            var self = this;
            self.slidebar = new slidebars();
            self.slidebar.init();
            self.body = $("#sbIndex");
            self.container = $(".mobile-menu");
            self.catalog = $(".mobile-menu .catalog");
            self.controller = $(".header-container .btn-nav");
        },
        initialize: function(){
            var self = this;
            self.construct();
            self.controller.on("click", function(){
                self.toggle();
            });
            self.container.swipe({
                swipeLeft: function (event, direction, distance, duration, fingerCount, fingerData, currentDirection) {
                    event.preventDefault();
                    if (distance >= 50) self.toggle();
                    console.log("You swiped " + direction);
                },
                swipeRight: function (event, direction, distance, duration, fingerCount, fingerData, currentDirection) {
                    event.preventDefault();
                    if (distance >= 50 && self.container.hasClass("shift")) self.unshift();
                    console.log("You swiped " + direction);
                }
            });
            self.catalog.on("click", ".sublevels > a", function(e){
                var li = $(this).closest("li"),
                    hover = li.hasClass("hover-in"),
                    sublevel = li.children(".dropdown");
                if (sublevel.length) {
                    e.preventDefault();
                    li.siblings("li").removeClass("hover-in");
                    li.addClass("hover-in");
                    self.shift();
                }
            }).on("click", ".return", function(e){
                e.preventDefault();
                var li = $(this).closest(".sublevels"),
                    hover = li.hasClass("hover-in");
                if (hover) self.unshift();
            }).on("click", ".close", function(e){
                e.preventDefault();
                self.toggle();
            });
        },
        toggle: function(){
            var self = this;
            if (!self.opened) self.open();
            else self.close();
        },
        open: function(){
            var self = this;
            if (!self.slidebar.getActiveSlidebar()) {
                self.slidebar.open("mobile-menu");
//                self.controller.addClass("cross");
                self.body.addClass("shift");
                $("html,body").addClass("noscroll");
                self.opened = true;
            }
        },
        close: function(){
            var self = this;
            if (self.slidebar.getActiveSlidebar()) {
                self.slidebar.close("mobile-menu");
//                self.controller.removeClass("cross");
                self.body.removeClass("shift");
                $("html,body").removeClass("noscroll");
                self.unshift();
                self.opened = false;
            }
        },
        shift: function(){
            var self = this;
            self.container.addClass("shift");
        },
        unshift: function(){
            var self = this;
            self.container.removeClass("shift");
            self.catalog.find(".hover-in").removeClass("hover-in");
        }
    };
    this.init_mobile = function(){
        return MobileMenu;
    };
};

function setZoom(el, eq) {
    eq = parseInt(eq)||2;
    $(el).zoom({
        magnify: eq,
        touch: true,
        url: $(el).data("original")
    });
}

function unSetZoom(el) {
    $(el).trigger('zoom.destroy');
}

// Equal height for div's in roduct grid
function equalGrid () {
    var Grid = $(".product-grid").find(".product-item, .load-more");
    if (Grid.length) {
        equalheight(Grid);
    }
}
function equalheight (container) {
    var currentTallest = 0,
        currentRowStart = 0,
        rowDivs = new Array(),
        $el,
        topPosition = 0;
    $(container).each(function() {
        $el = $(this);
        $($el).height('auto')
        topPostion = $el.position().top;
        if (currentRowStart != topPostion) {
            for (currentDiv = 0 ; currentDiv < rowDivs.length ; currentDiv++) {
                rowDivs[currentDiv].height(currentTallest);
            }
            rowDivs.length = 0; // empty the array
            currentRowStart = topPostion;
            currentTallest = $el.height();
            rowDivs.push($el);
        } else {
            rowDivs.push($el);
            currentTallest = (currentTallest < $el.height()) ? ($el.height()) : (currentTallest);
        }
        for (currentDiv = 0 ; currentDiv < rowDivs.length ; currentDiv++) {
            rowDivs[currentDiv].height(currentTallest);
        }
    });
}

function CModal() {
    var Modal = {
        opened: false,
        instance: null,
        construct: function() {
            var self = this;
            self.instance = $('#modalDialog').remodal();
        },
        open: function(url) {
            var self = this;
            $.ajax({
                url: url,
                dataType: "json",
                complete: function (response) {
                    if (response.status==200) {
                        var json = response.responseJSON;
                        if (json.output) {
                            $("#modalDialog").children(".remodal-content").html(json.output);
                            self.instance.open();
                            self.opened = true;
                        }
                    }
                },
                beforeSend: function () {
                    self.beforeOpen();
                }
            }); return false;
        },
        close: function() {
            var self = this;
            self.instance.close();
            self.opened = false;
            return false;
        },
        beforeOpen: function() {
            Basket.close();
            Basket.closeDialog();
        }
    };
    this.init = function() {
        return Modal;
    }
};

function CBasket() {
    var Basket = {
        body: null,
        items: new Array(),
        opened: false,
        dialogOpened: false,
        dialog: null,
        slidebar: null,
        basket_url: null,
        minicart: 'minicart', // Minicart widget ID
        basket: 'basketLayout', // Basket module layout ID
        minibasket: 'minibasket', // Checkout module layout ID
        construct: function(){
            var self = this;
            self.slidebar = new slidebars();
            self.slidebar.init();
            self.body = $("#sbIndex");
            self.dialog = $('#basketDialog').remodal();
            $(document).on('closed', '#basketDialog', function (e) {
                self.closeDialog();
                console.log('Modal is closed' + (e.reason ? ', reason: ' + e.reason : ''));
            });
            $(window).bind("keypress", function (e) {
                console.log(e.which);
                if (e.which == 27 && self.opened) self.close();
            });
        },
        setUrl: function(basket_url){
            var self = this;
            self.basket_url = basket_url;
        },
        add: function(ID, QTY, SetNewQty) {
            var self = this;
            ID = !empty(ID)? ID :false;
            QTY = parseInt(QTY)||1;
            SetNewQty = SetNewQty||0;
            if (typeof SetNewQty == 'undefined') SetNewQty = 0;
            if (ID) {
                $.ajax({
                    url: self.basket_url,
                    type: 'GET',
                    dataType: 'json',
                    data: {
                        action: 'add',
                        itemID: ID,
                        qty: QTY,
                        setNewQty: SetNewQty
                    },
                    complete: function (response) {
                        if (response.status=="200") {
                            if (!self.opened) self.open();
                            self.update();
                        }
                    }
                });
            }
        },
        remove: function(ID){
            var self = this;
            ID = !empty(ID)? ID: false;
            if (ID) {
                $.ajax({
                    url: self.basket_url,
                    type: 'GET',
                    dataType: 'json',
                    data: {
                        action: 'remove',
                        itemID: ID
                    },
                    complete: function (response) {
                        if (response.status=="200") self.update();
                    }
                });
            }
        },
        update: function(){
            var self = this;
            $.ajax({
                url: self.basket_url,
                type: 'GET',
                dataType: 'json',
                data: {
                    action: 'update'
                }, 
                complete: function (response) {
                    if (response.status=="200") {
                        var json = response.responseJSON;
                        if (json.output) {
                            if (!empty(json.output.basket) && !empty($('#'+self.basket))) {
                                $(document).find('#'+self.basket).html(json.output.basket);
                                $(window.parent.document).find('#'+self.basket).html(json.output.basket);
                            }
                            if (!empty(json.output.minicart) && !empty($('#'+self.minicart))) {
                                $(document).find('#'+self.minicart).replaceWith(json.output.minicart);
                                $(window.parent.document).find('#'+self.minicart).replaceWith(json.output.minicart);
                            }
                            if (!empty(json.output.minibasket) && !empty($('#'+self.minibasket))) {
                                $(document).find('#'+self.minibasket).html(json.output.minibasket);
                                $(window.parent.document).find('#'+self.minibasket).html(json.output.minibasket);
                            }
                            if (!empty(json.output.isEmpty) && !empty($("#"+self.basket))) {
                                var slider = $("#"+self.basket).find(".watched-slider");
                                if (!empty(slider)) {
                                    slider.swiper({
                                        slidesPerView: "auto",
                                        freeMode: true,
                                        spaceBetween: 24,
                                        scrollbar: slider.find(".swiper-scrollbar"),
                                        scrollbarHide: true,
                                        scrollbarDraggable: true,
                                        nextButton: slider.find(".swiper-button-next"),
                                        prevButton: slider.find(".swiper-button-prev"),
                                    });
                                }
                            }
                        }
                        if (json.output.items) self.updateItems(json.output.items);
                        self.updateButtons();
                    }
                }
            });
        },
        clear: function(){
            var self = this;
            $.ajax({
                url: self.basket_url,
                type: 'GET',
                dataType: 'json',
                data: {
                    action: 'clear'
                }, 
                complete: function (response) {
                    if (response.status=="200") self.update();
                }
            });
        },
        open: function(){
            var self = this;
            self.closeDialog();
            if (!self.opened) {
                self.slidebar.toggle("drop-basket");
                self.body.addClass("shift");
                $("html,body").addClass("noscroll");
                self.opened = true;
            }
        },
        close: function(){
            var self = this;
            if (self.opened) {
                self.slidebar.toggle("drop-basket");
                $("html,body").removeClass("noscroll");
                self.body.removeClass("shift");
                self.opened = false;
            }
            // close mobile filters if needed
            if (typeof MobileFilters != "undefined") MobileFilters.close();
            if (typeof MobileMenu != "undefined") MobileMenu.close();
        },
        openDialog: function(url){
            var self = this;
            $.ajax({
                url: url,
                type: "GET",
                dataType: "json",
                data: {
                    action: "basketDialog"
                },
                complete: function (response) {
                    if (response.status==200) {
                        var json = response.responseJSON;
                        if (json.output) {
                            $("#basketDialog").children(".remodal-content").html(json.output);
                            self.dialog.open();
                            self.dialogOpened = true;
                            setTimeout(function(){
                                var screen = $("#basketDialog").find(".product-image .screen a");
                                setZoom(screen, 1);
                            }, 100);
                        }
                    }
                },
                beforeSend: function () {
                    self.close();
                    self.closeDialog();
                }
            });
        },
        closeDialog: function () {
            var self = this;
            $("#basketDialog").children(".remodal-content").html("");
            self.dialog.close();
            self.dialogOpened = false;
        },
        updateItems: function (items) {
            var self = this;
            self.items = new Array();
            for (var idKey in items) self.items.push(idKey);
        },
        updateButtons: function () {
            var self = this,
                buttons = $(".product-flypage .add-to-cart");
            $.map(buttons, function(button, i){
                var key     = $(button).data("key"),
                    url     = $(button).data("url"),
                    in_cart = in_array(key, self.items),
                    onclick;
                if (in_cart) $(button).addClass("in-cart");
                else $(button).removeClass("in-cart");
                if (in_cart) {
                    onclick = "Basket.open();";
                } else {
                    onclick = "Basket.add('"+key+"', 1, 0);";
                }
                $(button).attr("onclick", onclick);
            });
        },
        changeOptions: function (ID, item, list) {
            var optionsInputs = $(item).find("*[id^='options_" + ID + "']"),
                idKey = ID;
            if (optionsInputs.length) {
                idKey += "|";
                $.each(optionsInputs, function (i, input) {
                    if (input.type=="radio" && !input.checked) return;
                    var optionID = $(input).data("optionid"),
                        similar  = $(item).find("input[data-optionid='" + optionID + "']"),
                        arValues = new Array();
                    if (similar.length) {
                        $.each(similar, function (j, cb) {
                            if (cb.checked) arValues.push(cb.value);
                        });
                    } else {
                        arValues.push(input.value);
                    }
                    idKey += $(input).data("optionid") + "=" + implode(",", arValues) + "/";
                });
            }
            $.ajax({
                url: '/interactive/ajax.php',
                type: 'GET',
                dataType: 'json',
                data: {
                    zone: 'site',
                    action: 'AjaxChangeProductOptions',
                    idKey: idKey,
                    list: list
                },
                success: function (json) {
                    if (json.button) {
                        $(item).find(".buttons").replaceWith(json.button);
                    }
                    if (json.price) {
                        $(item).find(".price").replaceWith(json.price);
                    }
                }
            });
            return false;
        }
    };
    this.init = function () {
        return Basket;
    };
}

